      ll = xe_tag_len (pctxt, TM_CTXT|TM_PRIM|3,
         asn1E_Ns10_Use_footer_name (pctxt, (Ns10_Use_footer_name)pvalue->use_footer_name, ASN1IMPL));
      if (ll < 0) return LOG_RTERR (pctxt, ll);
